import React from 'react';

const BookTable = ({ books, addToCart }) => {
  return (
    <div className="book-table">
      <table>
        <thead>
          <tr>
            <th>Title</th>
            <th>Description</th>
            <th>Price</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {books.map(book => (
            <tr key={book.id}>
              <td>{book.title}</td>
              <td>{book.description}</td>
              <td>${book.price}</td>
              <td><button onClick={() => addToCart(book)}>Add to Cart</button></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default BookTable;
